import React from 'react';

function DetailRecipe() {
    return (
        <div>
            <div className="recipes-list">
                {recipes.map(recipes => (
                    <div key={recipes.id} className="cards">
                        <img src={recipes.image} className="card-img" alt="Telangana Food" />
                        <div className="card-body">
                            <h5 className="card-title"><b>{recipes.title}</b></h5>
                        </div>
                        <Link to={recipes.id} className="cardbutton">Go to Course</Link>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default DetailRecipe;
